window.bookSummaryJSON = "<p><b>Russia is playing mind games...They've changed the rules.</b></p> <p><b>Can 280 characters destroy a nation?</b></p> <p>Avery Goodyear, a romance editor from the suburbs, becomes a player in an international game of psychological warfare.</p> <p>The FBI watches the attacks unfold in real time. The enemy's strategy: win hearts and minds to destroy American unity. The FBI focuses its secret weapon, ex-Army Ranger Rowan Kennedy, at the crisis.</p> <p>With a PhD in propaganda, Kennedy puts everything on the line to expose the wealthy oligarchs and high-powered schemers threatening our way of life...and to protect Avery.</p> <p>To beat the enemy at their own game, Rowan and Avery must break the rules. It only complicates things that they're falling in love.</p> <p>The game is on. The set is in play. Who will win the match?</p>"; 
